/*
* Sherlock considers a string to be valid if all characters of
* the string appear the same number of times. It is also valid
* if he can remove just 1 character at 1 index in the string,
* and the remaining characters will occur the same number of times.
* Given a string , determine if it is valid. If so, return YES,
* otherwise return NO.
* */

function findMode(numbers) {
  let counted = numbers.reduce((acc, curr) => {
    if (curr in acc) {
      acc[curr]++
    } else {
      acc[curr] = 1
    }

    return acc
  }, {})

  let mode = Object.keys(counted).reduce((a, b) => counted[a] > counted[b] ? a : b)

  return parseInt(mode)
}

function isAllEqual(arr) { arr.every(v => v === arr[0]) }

function isValid(s) {
  // Find how many time each character is repeated
  const charsMap = {}

  for (let i = 0, len = s.length; i < len; i++) {
    const char = s[i]
    if (charsMap[char]) {
      charsMap[char]++
    } else {
      charsMap[char] = 1
    }
  }

  // Put all frequencies in an array - this will be used to find which is the most common frequency
  const frequencies = []
  Object.entries(charsMap).forEach(e => frequencies.push(e[1]))

  // If all characters are repeated the same number of times we have a valid string
  if (isAllEqual(frequencies)) return 'YES'


  // Get the lowest and the highest frequency, i.e. the min and the max number of times
  // a character is repeated
  const highestFrequency = Math.max(...frequencies)
  const lowestFrequency = Math.min(...frequencies)

  // Find the most common frequency
  const mode = findMode(frequencies)

  // Find which is the element that is NOT common
  const lastManStanding = frequencies.filter(e => e !== mode)

  // If we have just one element left after removing the common  one and this element
  // is not equal to the highest frequency element - we have valid string
  if (lastManStanding.length === 1 && lastManStanding[0] !== highestFrequency) return 'YES'

  // Count how many times the lowest and highest frequency occurred
  const countMins = frequencies.filter((x) => {return x === lowestFrequency}).length
  const countMaxes = frequencies.filter((x) => {return x === highestFrequency}).length

  // If those counts are equal to 1 and the lowest frequency is just 1 less or is equal to the
  // highest frequency - we have valid string
  if ((lowestFrequency + 1 >= highestFrequency) && (countMins === 1 || countMaxes === 1)) {
    return 'YES'
  }

  // In all other cases the string is not valid
  return 'NO'
}

console.log(isValid('aaaaabc')) // NO
console.log(isValid('abc')) // YES
console.log(isValid('aabbc')) // YES
console.log(isValid('aaaabbcc')) // NO
console.log(isValid('abcc')) // YES
console.log(isValid('aabbcd')) // NO
console.log(isValid('aabbccddeefghi')) // NO
console.log(isValid('abcdefghhgfedecba')) // YES
console.log(isValid('')) // YES
console.log(isValid('')) // YES

